import React,{useState,useContext,useEffect} from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import { signinclient } from '../auth-api';
import AuthApi from './../utils/AuthApi';


import { signInStart } from '../redux/actions/userActions';
import { useDispatch, useSelector } from 'react-redux';

import { selectIsLoading, selectErrMsg, selectSuccessMsg } from '../redux/selectors/userSelector';



const useStyles = makeStyles((theme) => ({
  root: {
    height: '100vh',
  },
  image: {
    backgroundImage: 'url(https://i.pinimg.com/originals/85/dd/07/85dd0734b8922a6478016dc1b27ce9b4.gif)',
    backgroundRepeat: 'no-repeat',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },

  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

export default function Signinclient() {

  const dispatch = useDispatch();
	const isLoading = useSelector(state => selectIsLoading(state));
	let errMsg = useSelector(state => selectErrMsg(state));
	const successMsg = useSelector(state => selectSuccessMsg(state));

  const [input, setInput] = useState({ username: '', password: '' });
	const { username, password } = input;

  const handleChange = e => {
		const { name, value } = e.target;
		errMsg = '';

		setInput(prev => {
			return {
				...prev,
				[name]: value
			}
		})
	}


	useEffect(() => {
		document.title = 'Login';
	})

	const handleClick = e => {
		dispatch(signInStart(input));
	}


  const handleSignin =()=>{
    authApi.setAuth(true);
  };


  const [email,setEmail] = useState();
  const [pw,setPw] = useState();

  const classes = useStyles();
  const authApi = useContext(AuthApi);


const handleOnchange = (e)=> {
  if (e.target.name ==='email'){
    setEmail(e.target.value);
  }else{
    setPw(e.target.value);
  }
  };



const handleSigninclient = async (e) =>{
  e.preventDefault();
  const res = await signinclient({email,pw});
  if(res.data.auth){
    AuthApi.setAuth(true);
  }
};


  return (
    <Grid container component="main" className={classes.root}>
      <CssBaseline />
      <Grid item xs={false} sm={4} md={7} className={classes.image} />
      <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Avatar className={classes.avatar}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign in
          </Typography>
          <form className={classes.form} noValidate>

          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            autoFocus
            onChange={handleOnchange}
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            name="pw"
            label="Password"
            type="password"
            id="pw"
            autoComplete="current-password"
            onChange={handleOnchange}
          />


            <Button
              type="submit"
              fullWidth
              variant="contained"
              color="primary"
              className={classes.submit}
              onChange={handleSignin}
            >

              Sign In
            </Button>


          </form>
        </div>
      </Grid>
    </Grid>
  );
}
